#nullable enable
namespace MilkRun.Resources;
public static class SvgPngImageResource
{
    private readonly static string _chocolate = "data:image/svg+xml;base64,";
    public static string Chocolate => "chocolate.svg";
    private readonly static string _strawberry = "data:image/svg+xml;base64,";
    public static string Strawberry => "strawberry.svg";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("chocolate.svg", _chocolate);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("strawberry.svg", _strawberry);
    }
}